import { BrowserRouter, Routes, Route} from "react-router-dom";
import Home from "./components/home";
import Topnav from "./components/topnav";


function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/">
          <Topnav />
          <Home />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
